import React, {Component} from 'react';
import './Contact.css';

class Contact extends Component {
    render() {
        console.log('contact loaded')
        return (
            <div className="contactContainer">
                <p><a href="mailto:jameswj111@gmail.com" target="_blank">RESUME</a></p>
                <p><a href="https://github.com/jameswj11" target="_blank"></a>GITHUB</p>
                <p><a href="https://www.linkedin.com/in/jamesmingjohnson" target="_blank">LINKEDIN</a></p>
                <p><a href="/public/resume.pdf" target="_blank">RESUME</a></p>
            </div>
        )
    }
}

export default Contact;
